scriptlet.script:
osName = scriptletRawResult['osName'];
if (osName != null)
{
    osName = osName.toLowerCase();
    if ((osName.indexOf("sunos") != -1) || (osName.indexOf("solaris") != -1))
    {
        scriptletContext.put("remoteOS", "SOLARIS");
    }
    else if  (osName.indexOf("windows") != -1)
    {
        scriptletContext.put("remoteOS", "WINDOWS");
    }
    else if  (osName.indexOf("linux") != -1)
    {
        scriptletContext.put("remoteOS", "LINUX");
    }
    else //if (osName.indexOf("aix") != -1) || (osName.indexOf("hp-ux") != -1)
    {
        scriptletContext.put("remoteOS", "UNKNOWN");
    }
}
else
{
    scriptletContext.put("remoteOS", "UNKNOWN");
}
